import './App.css';

import React, { Component } from 'react'
import Navbar from './Component/Navbar';
import News from './Component/News';
import {
  BrowserRouter as Router,
  Route,
  Switch
} from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <Router>
        <div>
        <Navbar/>
        <Switch>
          <Route exact path="/"><News key="general" pageSize={20} category='general'/></Route>
          <Route exact path="/business"><News key="business" pageSize={20} category='business'/></Route>
          <Route exact path="/entertainment"><News key="entertainment" pageSize={20} category='entertainment'/></Route>
          <Route exact path="/general"><News key="general" pageSize={20} category='general'/></Route>
          <Route exact path="/health"><News key="health" pageSize={20} category='health'/></Route>
          <Route exact path="/science"><News key="science" pageSize={20} category='science'/></Route>
          <Route exact path="/sports"><News key="sports" pageSize={20} category='sports'/></Route>
          <Route exact path="/technology"><News key="technology" pageSize={20} category='technology'/></Route>
        </Switch>
      </div>
      </Router>

    )
  }
}
